                borderRadius: '10px',
            }} variant="top" src="https://webgradients.com/public/webgradients_png/041%20Happy%20Acid.png" />
            <Card.Body>
                <Card.Title>Project Title</Card.Title>
                <small>[project Dates]</small>
                <p>Project Type</p>
                <p>Skills Used</p>
                <div className = "">
                    <h6 className = "d-inline mr-3">Skill 1</h6>
